import styled from 'styled-components';

export const Container = styled.div`

    max-width: 1120px;
    margin: 0 auto;

    padding: 1rem 1rem;
    display: flex;
    flex-direction: column;
    justify-content: left;

    align-content: center;

    h2{
        padding: 1rem 0rem;
    }


`
